import React, { Component } from 'react';
import VoterIDSubmission from '../Components/VoterIDSubmission';
import VoterDetails from '../Components/VoterDetails';
import CandidateList from '../Components/CandidateList';
import "../css/user.css"
class User extends React.Component{
    state={
        statusCode:404,
        voterDetails:{
            name:"",
            age:" ",
            gender:" ",
            voterID:" ",
        }
    }
    setVoterDetails=(data)=>{
        this.voterDetails.name=data.name;
        this.voterDetails.age=data.age;
        this.voterDetails.gender=data.gender;
        this.voterDetails.voterID=data.voterID; 
    }
    render(){
        return(<div className="userMainDiv">
            <div className="headingDivUser"><span className="userTxtUser">User</span></div>
            <div className="bottomDivUser ">
                <div className="leftDivUser"> 
                    {this.state.statusCode===404 &&<VoterIDSubmission setVoterDetails={this.setVoterDetails}/>}
                    {this.state.statusCode===200 &&<VoterDetails voterDetails={this.state.voterDetails} />}

                </div>
                <div className="rightDivUser"> 
                    {this.state.statusCode===200 &&<CandidateList/>}

                </div>
            </div>

        </div>)
    }
}
export default User;
